sys_variable_value.value:
(function execute(inputs, outputs) {
  var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gcompute_spoke.list_instances', {
        "project_id": inputs.projectid,
        "zone": inputs.zone
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var instances = [];
    obj.forEach(function(instanceObj) {
        instances.push({
            "label": instanceObj.name.toUpperCase(),
            "name": instanceObj.name
        });
    })
    outputs.instances = {
        data: instances
    }
})(inputs, outputs);

